❗️Главное из нового брифинга официального представителя Минобороны России Игоря Конашенкова:

▪️Полностью заблокирован выход украинских военных к Азовскому морю;

▪️Вооруженными силами РФ в общей сложности уничтожено 1 325 объектов военной инфраструктуры Украины;

▪️Войска ЛНР продвинулись с начала проведения операции на глубину до 61 километра;

▪️Передовые отряды Народной милиции ДНР вышли на границу Донецкой области и соединились с частями ВС РФ;

▪️ВС РФ поразили высокоточными орудием два аэродрома и три радиолокационных поста ПВО Украины.

❗️Банк России объявил меры по поддержке кредитных организаций:

▪️с 28 февраля распускает накопленный макропруденциальный буфер капитала по необеспеченным потребкредитам и ипотеке;

▪️рекомендовал банкам не назначать пени и штрафы по кредитам на фоне санкций;

▪️разрешил банкам не ухудшать оценку положения заемщика при формировании резервов под потери.

⚡️Совместное заявление стран G7:

▪️Большая семерка намерена отключить некоторые российские банки от SWIFT;

▪️Также G7 намерена ограничить возможности получения россиянами "золотых паспортов";

▪️"Семерка" может ввести ограничительные меры в отношении Банка России;

▪️G7 планирует создать на этой неделе трансатлантическую рабочую группу для наблюдения за выполнением финансовых санкций против России;

▪️Будут проведены "инвентаризация и замораживание авуаров физических лиц и предприятий, которые подверглись санкциям в странах "семерки";

▪️Участники группы намерены также "применить санкции и иные меры финансового характера к чиновникам и представителям российской элиты, близким к правительству, а также в отношении их семей";

▪️Страны G7 договорились усилить координацию для борьбы с "дезинформацией и другими формами гибридной войны".

Заявление Минобороны РФ по военной операции на Украине. Главное.

• Российские военные заблокировали Киев с запада;

• Группировка войск ДНР в направлении Волновахи продвинулась на 11 километров вглубь обороны националистических батальонов. Подразделения ЛНР на Северодонецком направлении стремительными темпами продвинулись на глубину до 12 километров;

• Подразделения ВС РФ продолжают выполнение задач в районе Киева и других городов. Завершено блокирование Чернигова;

• ВСУ развернули на площади Шевченко в Киеве установки реактивных систем залпового огня "Град";

• Российские десантники высадились в районе аэродрома Гостомель в пригороде Киева. При захвате аэродрома уничтожено более 200 националистов подразделений Украины, потерь в ВС РФ нет;

• Зафиксированы случаи самосудов и расправ со стороны националистов над нежелающими воевать срочниками для устрашения ВСУ;

• Подразделения ВСУ в боевых действиях преимущественно не участвуют, ожесточенное сопротивление оказывают только батальоны украинских нацистов;

• Российские военнослужащие принимают все меры для недопущения жертв среди мирного населения на Украине;

• Националисты в боях в Донбассе действуют в качестве заградотрядов;

• Руководство Украины применяет методы террористов и хочет использовать украинцев как живой щит;

• Советники Пентагона и ЦРУ научили Киев расстановке в жилых кварталах реактивных артиллерийских систем для провоцирования ответного огня.
